<body>
  <div class="offline-icon"></div>
  <h1>Can't connect?</h1>
  <p>Looks like you don't have an internet connection right now.<br> Don't worry. Once you get connected to the internet,<br> it will automatically refresh back to the main page.</p>

  <script>
    function tryReconnect() {
      if (navigator.onLine) {
        location.reload();
      }
    }

    // Check immediately
    tryReconnect();

    // Poll every 3 seconds
    setInterval(tryReconnect, 3000);

    // Respond to system network changes
    window.addEventListener("online", tryReconnect);
  </script>
</body>
</html>
